import { Fragment } from "react";
import classes from "./MealItemForm.module.css"

const MealItemForm = () => {
  return (
    <Fragment>
        <section className={classes.form}>
      <label>Amount:</label>
      <input type="number" min="0"></input>
      <button>+ Add</button>
      </section>
    </Fragment>
  );
};
export default MealItemForm;
